NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'For Everyone Else',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<h2>Personal Income and Disposable Personal Income</h2>\n<p>BEAYs personal income measures the income received by persons from participation in production, from government and business transfers, and from holding interest-bearing securities and corporate stocks. Personal income also includes income received by nonprofit institutions serving households, by private non-insured welfare funds, and by private trust funds. BEA also publishes disposable personal income, which measures the income available to households after paying federal and state and local government income taxes.</p>\n<p>Income from production is generated both by the labor of individuals (for example, in the form of wages and salaries and of proprietors income) and by the capital that they own (in the form of rental income of persons). Income that is not earned from production in the current periodsuch as capital gains, which relate to changes in the price of assets over timeis excluded.</p>\n<p>BEAs monthly personal income estimates are one of several key macroeconomic indicators that the National Bureau of Economic Research considers when <a href=\"http://www.nber.org/cycles/recessions.html\">dating the business cycle</a>.</p>\n<p>Personal income and disposable personal income are provided both as aggregate and as per capita statistics. BEA produces monthly estimates of personal income for the nation, quarterly estimates of state personal income, and annual estimates of local-area personal income. More information is found on <a href=\"http://www.bea.gov/national/index.htm#personal\">BEA\'s website</a>.</p>\n<h2>Census Money Income</h2>\n<p>The Census Bureau collects income data on several major surveys, including the Annual Social and Economic Supplement (ASEC) of the <a href=\"http://www.census.gov/cps/\">Current Population Survey</a> (CPS), the <a href=\"http://www.census.gov/sipp/\">Survey of Income and Program Participation</a> (SIPP), and the <a href=\"http://www.census.gov/acs/www/\">American Community Survey</a> (ACS). The CPS is the source of the official national estimates of poverty and the most widely cited source of annual household income estimates for the United States.<sup id=\"cite_ref-US_Census_Bureau_7-0\"><a href=\"http://en.wikipedia.org/wiki/Personal_income_in_the_United_States#cite_note-US_Census_Bureau-7\">[8]</a></sup></p>\n<p>The CPS measure of money income is defined as the total pre-tax cash income received by people on a regular basis, excluding certain lump-sum payments and excluding capital gains.</p>\n<p>The Census Bureau also produces <a href=\"http://www.census.gov/hhes/www/cpstables/032010/rdcall/toc.htm\">alternative estimates of income and poverty</a> based on broadened definitions of income that include many of these income components that are not included in money income.</p>\n<p>The Census Bureau releases estimates of household money income as medians, percent distributions by income categories, and on a per capita basis. Estimates are available by demographic characteristics of householders and by the composition of households. More details on income concepts and sources are found on the <a href=\"http://www.census.gov/hhes/www/income/about/index.html\">Census Bureaus website</a>.</p>\n<h2>By educational attainment</h2>\n<table>\n<tbody>\n<tr><th style=\"text-align: left;\">Measure</th><th>High school graduate</th><th>Associate\'s degree</th><th>Bachelor\'s degree</th><th>Master\'s degree</th><th>Professional degree</th><th>Doctorate degree</th></tr>\n<tr>\n<td style=\"text-align: left;\">Persons, age 25+ w/ earnings</td>\n<td>$26,505</td>\n<td>$35,009</td>\n<td>$43,143</td>\n<td>$52,390</td>\n<td>$82,473</td>\n<td>$69,432</td>\n</tr>\n<tr>\n<td style=\"text-align: left;\">Male, age 25+ w/ earnings</td>\n<td>$32,085</td>\n<td>$42,382</td>\n<td>$52,265</td>\n<td>$67,123</td>\n<td>$100,000</td>\n<td>$78,324</td>\n</tr>\n<tr>\n<td style=\"text-align: left;\">Female, age 25+ w/ earnings</td>\n<td>$21,117</td>\n<td>$29,510</td>\n<td>$36,532</td>\n<td>$45,730</td>\n<td>$66,055</td>\n<td>$54,666</td>\n</tr>\n<tr>\n<td style=\"text-align: left;\">Persons, age 25+, employed full-time</td>\n<td>$31,539</td>\n<td>$40,588</td>\n<td>$50,944</td>\n<td>$61,273</td>\n<td>$100,000</td>\n<td>$79,401</td>\n</tr>\n</tbody>\n</table>\n<h2>Income distribution</h2>\n<p>Of those individuals with income who were older than 25 years of age, over 42% had incomes below $25,000 while the top 10% had incomes exceeding $82,500 a year. The distribution of income among individuals differs substantially from <a href=\"http://en.wikipedia.org/wiki/Household_income_in_the_United_States\" title=\"Household income in the United States\">household incomes</a> as 42% of all households had two or more income earners. As a result 20.5% of households have <a href=\"http://en.wikipedia.org/wiki/Six_figure_income\" title=\"Six figure income\">six figure incomes</a>, even though only 6.24% of Americans had incomes exceeding $100,000. The following chart shows the income distribution among all 211,832,000 individuals aged 15 or higher as recorded by the United States Census Bureau.</p>\n<table>\n<tbody>\n<tr><th>Income range</th><th>Number of individuals <br> (in thousands)</th><th>Percent in group</th><th>Percent Below</th><th colspan=\"3\">Cumulative percentages</th></tr>\n<tr>\n<td>Under $2,500</td>\n<td>12,945</td>\n<td>6.11</td>\n<td>0</td>\n<td rowspan=\"10\">\n<p>less than $25k<br> 47.39%</p>\n<p>less than $50k<br> 75.40%</p>\n</td>\n</tr>\n<tr>\n<td>$2,500 to $4,999</td>\n<td>7,408</td>\n<td>3.50</td>\n<td>6.11</td>\n</tr>\n<tr>\n<td>$5,000 to $7,499</td>\n<td>9,980</td>\n<td>4.71</td>\n<td>9.61</td>\n</tr>\n<tr>\n<td>$7,500 to $9,999</td>\n<td>11,496</td>\n<td>5.43</td>\n