>Lessons &amp; Rentals</h2>\n<p class=\"lead\">BM offers a variety of on-snow programs for outdoor enthusiasts of all ages and skill levels. All programs emphasize safety and enjoyment while teaching technique, an appreciation for the environment, and fostering individual growth.</p>\n<h3 style=\"margin-top: 50px;\">Private Lessons</h3>\n<table class=\"table table-striped\">\n<tbody>\n<tr><th width=\"40%\">&nbsp;</th><th width=\"15%\">Member</th><th width=\"15%\">Client</th><th width=\"15%\">Guest (Adult)</th><th width=\"15%\">Guest (Child)</th></tr>\n<tr>\n<td>1 Hour</td>\n<td>FREE</td>\n<td>$299</td>\n<td>$399</td>\n<td>$299</td>\n</tr>\n<tr>\n<td>1/2 Day (3 hours)</td>\n<td>FREE</td>\n<td>$599</td>\n<td>$999</td>\n<td>$599</td>\n</tr>\n<tr>\n<td>All Day (6 hours)</td>\n<td>FREE</td>\n<td>$999</td>\n<td>$1299</td>\n<td>$999</td>\n</tr>\n</tbody>\n</table>\n</div>\n<div class=\"wow fadeIn\" data-wow-offset=\"100\">\n<h3 style=\"margin-top: 50px;\">Group Lessons</h3>\n<table class=\"table table-striped\">\n<tbody>\n<tr><th width=\"40%\">&nbsp;</th><th width=\"15%\">Member</th><th width=\"15%\">Client</th><th width=\"15%\">Guest (Adult)</th><th width=\"15%\">Guest (Child)</th></tr>\n<tr>\n<td>1 Hour</td>\n<td>FREE</td>\n<td>$199</td>\n<td>$299</td>\n<td>$199</td>\n</tr>\n<tr>\n<td>1/2 Day (3 hours)</td>\n<td>FREE</td>\n<td>$299</td>\n<td>$399</td>\n<td>$299</td>\n</tr>\n<tr>\n<td>All Day (6 hours)</td>\n<td>FREE</td>\n<td>$599</td>\n<td>$699</td>\n<td>$599</td>\n</tr>\n</tbody>\n</table>\n<div class=\"alert alert-info\">Recommended gratuities are $75 per skier</div>\n</div>\n<div class=\"wow fadeIn\" data-wow-offset=\"100\">\n<h3 style=\"margin-top: 50px;\">Rentals</h3>\n<table class=\"table table-striped\">\n<tbody>\n<tr><th width=\"40%\">Equipment</th><th width=\"15%\">Member</th><th width=\"15%\">Client</th><th width=\"15%\">Guest (Adult)</th><th width=\"15%\">Guest (Child)</th></tr>\n<tr>\n<td>Ski Package</td>\n<td>FREE</td>\n<td>$59</td>\n<td>$79</td>\n<td>$59</