lton Downtown Nashville\" style=\"height:50px;width:auto;\"></div>\n							</li>\n							<li data-target=\"#carousel-hotel\" data-slide-to=\"5\">\n								<div class=\"item\"><img src=\"img/hotel5.jpg\" alt=\"Hilton Downtown Nashville\" style=\"height:50px;width:auto;\"></div>\n							</li>\n							<li data-target=\"#carousel-hotel\" data-slide-to=\"6\">\n								<div class=\"item\"><img src=\"img/hotel6.jpg\" alt=\"Hilton Downtown Nashville\" style=\"height:50px;width:auto;\"></div>\n							</li>\n							<li data-target=\"#carousel-hotel\" data-slide-to=\"7\">\n								<div class=\"item\"><img src=\"img/hotel7.jpg\" alt=\"Hilton Downtown Nashville\" style=\"height:50px;width:auto;\"></div>\n							</li>\n							<li data-target=\"#carousel-hotel\" data-slide-to=\"8\">\n								<div class=\"item\"><img src=\"img/hotel8.jpg\" alt=\"Hilton Downtown Nashville\" style=\"height:50px;width:auto;\"></div>\n							</li>\n							<li data-target=\"#carousel-hotel\" data-slide-to=\"9\">\n								<div class=\"item\"><img src=\"img/hotel9.jpg\" alt=\"Hilton Downtown Nashville\" style=\"height:50px;width:auto;\"></div>\n							</li>\n							<li data-target=\"#carousel-hotel\" data-slide-to=\"10\">\n								<div class=\"item\"><img src=\"img/hotel10.jpg\" alt=\"Hilton Downtown Nashville\" style=\"height:50px;width:auto;\"></div>\n							</li>\n						</ol>\n					</div>\n				</div>\n\n				<div class=\"col-md-6 col-sm-12\">\n					<div class=\"wow fadeInRight\" data-wow-delay=\"1.2s\">\n						<p>Bear Mountain in Colorado offers the finest skiing conditions in the world. We call it Private Powder and it\'s here exclusively for our Members, their families, clients and invited guests.</p>\n						<p>Arguably, the most exclusive ski resort in the world, offering something you can\'t get anywhere else. You can be super-rich and super-safe all at the same time. It\'s the only place in the world where you can ski without bodyguards. That\'s not to say there aren\'t any here; resort security is handled by former US Secret Service Agents. While most resorts have \'mountain huts\' we have \'Sugar Shacks\', where you can tuck in to homemade sweet treats and gourmet coffee.</p>\n						<p>Apres-ski: Take a private snow cat dinner excursion to Timberline Lodge or combine dinner with a spot of night skiing at Rainbow Lodge.</p></p>\n						<hr>\n						<h3>Getting Here</h3>\n						<div class=\"row\">\n							<div class=\"col-sm-5 hidden-xs\">\n								<div style=\"text-align:center\"><img src=\"img/map.jpg\"></div>\n							</div>\n							<div class=\"col-sm-7 col-xs-12\">\n								<address>\n									<strong>Bear Lodge Private Airport</strong><br>\n									2300 Claw Circle<br>Bear Moutain, CO 80487<br>\n									<abbr title=\"Phone\">P:</abbr> 615.620.2050\n								</address>\n							</div>\n						</div>\n					</div>			\n				</div>\n			</div>\n		</div>\n	</div>\n	\n	<div class=\"image-wrapper bg-image-1 hidden-xs\" data-stellar-background-ratio=\"0.5\"></div>\n	\n	<div class=\"content-wrapper\" id=\"tickets\">\n		<div class=\"container\">\n			<div class=\"row\">\n				<div class=\"col-sm-12\">\n					<h2>Tickets &amp; Passes</h2>\n					<p>Exclusively for our Members, their families, and invited guests.</p>\n					<h3>Tickets</h3>\n					<table class=\"table table-striped table-bordered agenda-table\">\n						<tbody>\n							<tr>\n								<th width=\"40%\">Lift Tickets</th>\n								<th width=\"15%\">Member</th>\n								<th width=\"15%\">Client</th>\n								<th width=\"15%\">Guest (Adult) <sup>*</sup></th>\n								<th width=\"15%\">Guest (Child) <sup>**</sup></th>\n							</tr>\n							<tr>\n								<td>1 Day</td>\n								<td>FREE</td>\n								<td>$159</td>\n								<td>$399</td>\n								<td>$199</td>\n							</tr>\n							<tr>\n								<td>2 Day</td>\n								<td>FREE</td>\n								<td>$299</td>\n								<td>$599</td>\n								<td>$359</td>\n							</tr>\n							<tr>\n								<td>3 Day</td>\n								<td>FREE</td>\n								<td>$399</td>\n								<td>$799</td>\n								<td>$499</td>\n							</tr>\n							<tr>\n								<td>4 Day</td>\n								<td>FREE</td>\n								<td>$499</td>\n								<td>$999</td>\n								<td>$549</td>\n							</tr>\n							<tr>\n								<td>Week Pass</td>\n								<td>FREE</td>\n								<td>$699</td>\n								<td>$1299</td>\n								<td>$749</td>\n							</tr>\n							<tr>\n								<td>Annual Pass</td>\n								<td>FREE</td>\n								<td>$12,999</td>\n								<td>NA</td>\n								<td>NA</td>\n							</tr>\n						</tbody>\n					</table>\n					<div class=\"alert alert-warning\">\n						* All guest must be accompanied by a member at all times while on premisses.<br>\n						** Accompanied guest 12 years old and younger. \n					</div>\n				</div><!--/span12 -->\n			</div><!--/row -->\n		</div><!--/container -->\n	</div>\n	\n	<hr class=\"hr-lg\">\n	\n	<div class=\"content-wrapper\" id=\"rentals\">\n		<div class=\"container\">\n			<div class=\"row\">\n				<div class=\"col-sm-12\">\n					\n					<div class=\"wow fadeIn\" data-wow-offset=\"150\">\n						<h2>Lessons &amp; Rentals</h2>\n						<p class=\"lead\">BM offers a variety of on-snow programs for outdoor enthusiasts of all ages and skill levels. All programs emphasize safety and enjoyment while teaching technique, an appreciation for the environment, and fostering individual growth.</p> \n						\n						<h3 style=\"margin-top: 50px;\">Private Lessons</h3>\n						<table class=\"table table-striped\">\n							<tr>\n								<th width=\"40%\">&nbsp;</th>\n								<th width=\"15%\">Member</th>\n								<th width=\"15%\">Client</th>\n								<th width=\"15%\">Guest (Adult)</th>\n								<th width=\"15%\">Guest (Child)</th>\n							</tr>\n							<tr>\n								<td>1 Hour</td>\n								<td>FREE</td>\n								<td>$299</td>\n								<td>$399</td>\n								<td>$299</td>\n							</tr>\n							<tr>\n								<td>1/2 Day (3 hours)</td>\n								<td>FREE</td>\n								<td>$599</td>\n								<td>$999</td>\n								<td>$599</td>\n							</tr>\n							<tr>\n								<td>All Day (6 hours)</td>\n								<td>FREE</td>\n								<td>$999</td>\n								<td>$1299</td>\n								<td>$999</td>\n							</tr>\n						</table>\n					</div>\n					\n					<div class=\"wow fadeIn\" data-wow-offset=\"100\">\n						<h3 style=\"margin-top: 50px;\">Group Lessons</h3>\n						<table class=\"table table-striped\">\n							<tr>\n								<th width=\"40%\">&nbsp;</th>\n								<th width=\"15%\">Member</th>\n								<th width=\"15%\">Client</th>\n								<th width=\"15%\">Guest (Adult)</th>\n								<th width=\"15%\">Guest (Child)</th>\n							</tr>\n							<tr>\n								<td>1 Hour</td>\n								<td>FREE</td>\n								<td>$199</td>\n								<td>$299</td>\n								<td>$199</td>\n							</tr>\n							<tr>\n								<td>1/2 Day (3 hours)</td>\n								<td>FREE</td>\n								<td>$299</td>\n								<td>$399</td>\n								<td>$299</td>\n							</tr>\n							<tr>\n								<td>All Day (6 hours)</td>\n								<td>FREE</td>\n								<td>$599</td>\n								<td>$699</td>\n								<td>$599</td>\n							</tr>\n						</table>\n						\n						<div class=\"alert alert-info\">\n							Recommended gratuities are $75 per skier \n						</div>\n					</div>\n					\n					<div class=\"wow fadeIn\" data-wow-offset=\"100\">\n						<h3 style=\"margin-top: 50px;\">Rentals</h3>\n						<table class=\"table table-striped\">\n							<tr>\n								<th width=\"40%\">Equipment</th>\n								<th width=\"15%\">Member</th>\n								<th width=\"15%\">Client</th>\n								<th width=\"15%\">Guest (Adult)</th>\n								<th width=\"15%\">Guest (Child)</th>\n							</tr>\n							<tr>\n								<td>Ski Package</td>\n								<td>FREE</td>\n								<td>$59</td>\n								<td>$79</td>\n								<td>$59</td>\n							</tr>\n							<tr>\n								<td>Snowboard Package</td>\n								<td>FREE</td>\n								<td>$59</td>\n								<td>$79</td>\n								<td>$59</td>\n							</tr>\n							<tr>\n								<td>Mt. Bike Package</td>\n								<td>FREE</td>\n								<td>$59</td>\n								<td>$79</td>\n								<td>$59</td>\n							</tr>\n	