s for a department, inventory business unit, or all locations.\\t* Item ID                                                                                            * Description                                                                                    * Dept ID                                                                                            * Months                                                                                           * Monthly cost                                                                                  * UOM                                                                                               * Monthly Average                                                                         * YTD Qty Issued                                                                           * YTD Item Cost                                                                            * Currency\\t* Calendar Year              * Business Unit              * Items ID (All, Single, Range)                            * Department ID (All, Range, Specific)\\tAs needed\\t\\tInventory\\tPSNT\\tInventory>Manage Inventory>Reports>Issues History\\n\\tPar Stock Usage\\tThis report provides detailed monthly or periodic item usage information for selected par locations.\\t\\t* Par Location (All, Specific, Group)             * Summarize by goup,  month or fiscal year.\\tAs needed\\t\\tInventory\\tPSNT\\tInventory>Repenish Par locations>Par Stock Usage Report\\n\\tCounting Sheet\\tThis report displays the storage locations of items included in a counting event.  You can use this report to record the count results for each location listed.\\t* Counting Event Number                                                           * Item ID                                                                                           * Storage Location                                                                          * Description                           