s trace the origin of any issues that may exists.  You should use the audit reports during system implemenation and during your testing process for system modifications.  PeopleSoft recomends that you run the audit reports as part of your standard system maintence procedures.\\t* BU On hand Quantity                                                             * BU Reserved Quantity                                                               * BU Available Quantity                                                             * BU Owned Quantity\\t* Inventory BU                       * All Items/Single Item\\tAs needed\\t\\tInventory\\tPSNT\\tInventory>Manage Inventory>Reports>Inventory Balances\\n\\tInventory On Hand Value Report\\tLists on-hand quantity and value at the summary or detail level. Can be used for items with any cost method. The report can calculate WIP as of any point in time and is accurate to the extent that the Transaction Costing, Accounting Line Creation, and Journal Generator processes have been run. The report can also store snapshots of previously generated report data for historical reporting. Select the items that are to appear on the report by business unit, cost book, cost profile, item information, or accounting period. In addition, you can use it to compare the on-hand value by using floor and ceiling costs or last price used.\\t* Transaction Date                                                                          * Posted Date                                                                                                                                               * Storage Area                                                                                            * Receiver ID                                                                                                                      * On Hand Quantity                                                                                             * Cost Element           