on folder
for each row
begin
declare old_parent_path varchar(255);declare old_path varchar(255);declare new_path varchar(255);declare old_name varchar(255);declare hostinode varchar(100);if @disable_trigger is null and new.name<>old.name then
	select asset_name,parent_path,host_inode into old_name,old_parent_path,hostinode from identifier where id = new.identifier;select concat(old_parent_path,old_name,'/')into old_path;select concat(old_parent_path,new.name,'/')into new_path;set @disable_trigger = 1;update identifier set asset_name = new.name where id = new.identifier;set @disable_trigger = null;call renamefolderchildren(old_path,new_path,hostinode);end if;end */;;
