/*!50003 CREATE*/ /*!50017 DEFINER=`nemo`@`%`*/ /*!50003 trigger check_parent_path_when_insert  before insert
on identifier
for each row
begin
declare idcount int;declare caninsert boolean default false;select count(id)into idcount from identifier where asset_type='folder' and concat(parent_path,asset_name,'/')= new.parent_path and host_inode = new.host_inode and id <> new.id;if(idcount > 0 or new.parent_path = '/' or new.parent_path = '/system folder') then
   set caninsert := true;end if;if(caninsert = false) then
  delete from cannot_insert_for_this_path_does_not_exist_for_the_given_host;end if;end */;;
DELIMITER ;
