/*!50003 CREATE*/ /*!50017 DEFINER=`nemo`@`%`*/ /*!50003 trigger check_child_assets before delete
on identifier
for each row
begin
  declare pathcount int;if(old.asset_type ='folder') then
      select count(*) into pathcount from identifier where parent_path = concat(old.parent_path,old.asset_name,'/') and host_inode = old.host_inode;end if;if(old.asset_type ='contentlet') then
	 select count(*) into pathcount from identifier where host_inode = old.id;end if;if(pathcount > 0) then
   delete from cannot_delete_as_this_path_has_children;end if;end */;;
